import './ResortList';
import React from 'react';
import axios from 'axios';

const url = 'https://api.openweathermap.org/data/2.5/weather'

function Resort(props) {
    const [res, setRes] = React.useState(null)

    React.useEffect(() => {
        axios.get(url, { params: {lat: props.lat, lon: props.lon, appid: props.appid, units: "imperial"}}).then((response) => {
            setRes(response.data)
            console.log('temp: ', response.data)
        });
    }, [props]);

    if (!res) return null;

    return (
        <div className='Resort'>
            <h1>{props.resortName}</h1>
            {res.main ? <h3>temp: {res.main.temp} </h3> : null}
            {res.main ? <h3>high: {res.main.temp_max} </h3> : null }
            {res.main ? <h3>low: {res.main.temp_min} </h3> : null }
            {res.weather ? <h3>weather: {res.weather[0].main} </h3> : null}
            {res.wind ? <h3>wind: {res.wind.speed} </h3> : null}
        </div>
    );
}

export default Resort;
